import React from "react";
import classes from "./MyPosts.module.css";

const MyPosts = () => {
  return (
    <div>
      My posts 
      <div></div>


    <div className={classes.posts}>
      <textarea></textarea>
      <button>Add post</button>
      <button>Remove</button>
      <div>New post</div>
      <div className={classes.item}><img src='https://external-preview.redd.it/nhlyjxZWf4pHkkF4KfXO1aMywxz1tCG6BKSmQYyV7QU.jpg?auto=webp&s=423d4afcf9f028ad8f06d44eee67a8ca7670a5f4'/> post 1</div>
      <div className={classes.item}>post 2</div>
    </div>
    </div>
  );
};

export default MyPosts;
